--JAZZ STANDARDS DATABASE
--Kristina Gavin Bigsby 
--Data collected from Jazz Standard Repertoire (https://standardrepertoire.com/) and Jazz Standards (https://www.jazzstandards.com/)

--DROP TABLES
DROP TABLE CREDITS;
DROP TABLE WRITERS;
DROP TABLE SONGS;
DROP TABLE WORKS;

--CREATE TABLES
CREATE TABLE WORKS (
    WorkID CHAR(5) NOT NULL,
    Title VARCHAR2(100) NOT NULL,
    WorkType VARCHAR2(25) NOT NULL CHECK (WorkType IN ('Film','Musical','Opera','Operetta')),
    CONSTRAINT WORKS_PK PRIMARY KEY (WorkID)
);

CREATE TABLE SONGS (
    SongID CHAR(5) NOT NULL,
    Song VARCHAR2(100) NOT NULL,
    Year NUMBER(4,0) NOT NULL CHECK (Year BETWEEN 1000 AND 9999),
    WorkID CHAR(5),
    TimeSignature NUMBER(2,0) NOT NULL CHECK (TimeSignature > 0),
    KeySignature VARCHAR2(25) NOT NULL CHECK (KeySignature IN ('A', 'A minor', 'Ab', 'Ab minor', 'B', 'B minor', 'Bb', 'Bb minor', 'C', 'C minor', 'C#', 'C# minor', 'D', 'D minor', 'Db', 'Db minor', 'E', 'E minor', 'Eb', 'Eb minor', 'F', 'F minor', 'F#', 'F# minor', 'G', 'G minor', 'Gb', 'Gb minor')),
    Bars NUMBER(2,0) NOT NULL CHECK (Bars > 0),
    Form VARCHAR2(10),
    Style VARCHAR2(10) NOT NULL CHECK (Style IN ('Bossa','Latin','Waltz','Bebop','Ballad','Gospel','Blues','Mambo','Modal','Funk','Swing')),
    Lyrics VARCHAR2(25),
    Ranking NUMBER(4,0) CHECK (Ranking BETWEEN 1 AND 1000),
    Calls NUMBER(3,0) NOT NULL CHECK (Calls >= 0),
    ContrafactID CHAR(5),
    CONSTRAINT SONGS_PK PRIMARY KEY (SongID),
    CONSTRAINT SONGS_FK1 FOREIGN KEY (WorkID) REFERENCES WORKS (WorkID),
    CONSTRAINT SONGS_FK2 FOREIGN KEY (ContrafactID) REFERENCES SONGS (SongID)
);

CREATE TABLE WRITERS (
    WriterID CHAR(5) NOT NULL,
    FirstName VARCHAR2(25) NOT NULL,
    MiddleName VARCHAR2(25),
    LastName VARCHAR2(25) NOT NULL,
    SuffixName VARCHAR2(5),
    Born NUMBER(4,0) CHECK (Born BETWEEN 1000 AND 9999),
    Died NUMBER(4,0) CHECK (Died BETWEEN 1000 AND 9999),
    Sex CHAR(1),
    Race VARCHAR2(25),
    Birthplace VARCHAR2(25),
    CONSTRAINT WRITERS_PK PRIMARY KEY (WriterID)
);

CREATE TABLE CREDITS (
    SongID CHAR(5) NOT NULL,
    WriterID CHAR(5) NOT NULL,
    Credit VARCHAR2(10) NOT NULL CHECK (Credit IN ('Music','Lyrics')),
    CONSTRAINT CREDITS_PK PRIMARY KEY (SongID, WriterID, Credit),
    CONSTRAINT CREDITS_FK1 FOREIGN KEY (SongID) REFERENCES SONGS (SongID),
    CONSTRAINT CREDITS_FK2 FOREIGN KEY (WriterID) REFERENCES WRITERS (WriterID)
);

